import { Link } from "react-router-dom";
import "./styles.css";

function Header() {
  return (
    <header className="head">
      <Link to="/">JamesTip</Link>
      <Link to="/cadastro">Cadastrar produto</Link>
      <Link to="/produtos">Meus produtos</Link>
    </header>
  );
}
export default Header;
